<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <style>
        #map {
            width: 1446px;
            height: 1877px;
        }
        </style>
        <title></title>
    </head>
    <body>
        <div id="map">
        </div>
        <script src="js/qgis2web_expressions.js"></script>
        <script src="js/leaflet.js"></script>
        <script src="js/leaflet.rotatedMarker.js"></script>
        <script src="js/leaflet.pattern.js"></script>
        <script src="js/leaflet-hash.js"></script>
        <script src="js/Autolinker.min.js"></script>
        <script src="js/rbush.min.js"></script>
        <script src="js/labelgun.min.js"></script>
        <script src="js/labels.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[-12.899129586100285,-77.47700960886223],[-10.618241801901055,-75.7204218966576]]);
        var hash = new L.Hash(map);
        map.attributionControl.setPrefix('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a> &middot; <a href="https://leafletjs.com" title="A JS library for interactive maps">Leaflet</a> &middot; <a href="https://qgis.org">QGIS</a>');
        var autolinker = new Autolinker({truncate: {length: 30, location: 'smart'}});
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        map.createPane('pane_CartoDB_0');
        map.getPane('pane_CartoDB_0').style.zIndex = 400;
        var layer_CartoDB_0 = L.tileLayer('http://a.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}.png', {
            pane: 'pane_CartoDB_0',
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 25
        });
        layer_CartoDB_0;
        map.addLayer(layer_CartoDB_0);
        map.createPane('pane_hillshade_1');
        map.getPane('pane_hillshade_1').style.zIndex = 401;
        var img_hillshade_1 = 'data/hillshade_1.png';
        var img_bounds_hillshade_1 = [[-12.172222222222217,-77.17027777777794],[-11.457499999999996,-76.04916666666682]];
        var layer_hillshade_1 = new L.imageOverlay(img_hillshade_1,
                                              img_bounds_hillshade_1,
                                              {pane: 'pane_hillshade_1'});
        bounds_group.addLayer(layer_hillshade_1);
        map.addLayer(layer_hillshade_1);
        map.createPane('pane_dem_subset_2');
        map.getPane('pane_dem_subset_2').style.zIndex = 402;
        var img_dem_subset_2 = 'data/dem_subset_2.png';
        var img_bounds_dem_subset_2 = [[-12.172222222222217,-77.17027777777794],[-11.457499999999996,-76.04916666666682]];
        var layer_dem_subset_2 = new L.imageOverlay(img_dem_subset_2,
                                              img_bounds_dem_subset_2,
                                              {pane: 'pane_dem_subset_2'});
        bounds_group.addLayer(layer_dem_subset_2);
        map.addLayer(layer_dem_subset_2);
        setBounds();
        L.ImageOverlay.include({
            getBounds: function () {
                return this._bounds;
            }
        });
        </script>
    </body>
</html>
